import React from "react";
import { Card, Button } from "react-bootstrap";

export default function Cards({ pokemos }) {
    const { name, stats, src, types } = pokemos;
  
    return (
    <Card styleclassName="col-lg-3 col-md-6 col-sm-12">
      <Card.Img variant="top" src={pokemos.image} />
      <Card.Body>
        <Card.Title>{pokemos.name}</Card.Title>
        <Card.Text>Especie: {pokemos.species}</Card.Text>
        <Button variant="primary">Go somewhere</Button>
      </Card.Body>
    </Card>
  );
}
